        public static void Init(LibraryLoader loader, bool disableRemovedProcs = false, bool loadExtensions = true, bool loadExtensionProcs = true, bool loadLeftovers = false) {

            if (loaded) { return; }

            var proc = IntPtr.Zero;
            var oglloader = Marshal.GetDelegateForFunctionPointer<GetProcAddressHandler>(loader.LoadFunction("wglGetProcAddress"));

            Func<string, IntPtr> loadProc = (string name) => 
            {
                var handle = loader.LoadFunction(name);

                return (handle == IntPtr.Zero) ? oglloader(name) : handle;
            };
 

            if(Functions.glGetIntegerv == null) {
                if((proc = loadProc("glGetIntegerv")) != IntPtr.Zero) {
                    Functions.glGetIntegerv = (Delegates.glGetIntegerv)Marshal.GetDelegateForFunctionPointer(proc, typeof(Delegates.glGetIntegerv));
                }
            }
            
            var versionMajor = 0;
            var versionMinor = 0;
            if(Functions.glGetIntegerv != null) 
            {
                unsafe
                {
                    int versionNumber = 0;

                    Functions.glGetIntegerv(Constants.GL_MAJOR_VERSION, &versionNumber);
                    versionMajor = versionNumber;
                    Functions.glGetIntegerv(Constants.GL_MINOR_VERSION, &versionNumber);
                    versionMinor = versionNumber;
                }
            }
            
            var version = (byte)(versionMajor * 10 + versionMinor);
            if(version >= 10) Features.GL_VERSION_1_0 = true;
            if(version >= 11) Features.GL_VERSION_1_1 = true;
            if(version >= 12) Features.GL_VERSION_1_2 = true;
            if(version >= 13) Features.GL_VERSION_1_3 = true;
            if(version >= 14) Features.GL_VERSION_1_4 = true;
            if(version >= 15) Features.GL_VERSION_1_5 = true;
            if(version >= 20) Features.GL_VERSION_2_0 = true;
            if(version >= 21) Features.GL_VERSION_2_1 = true;
            if(version >= 30) Features.GL_VERSION_3_0 = true;
            if(version >= 31) Features.GL_VERSION_3_1 = true;
            if(version >= 32) Features.GL_VERSION_3_2 = true;
            if(version >= 33) Features.GL_VERSION_3_3 = true;
            if(version >= 40) Features.GL_VERSION_4_0 = true;
            if(version >= 41) Features.GL_VERSION_4_1 = true;
            if(version >= 42) Features.GL_VERSION_4_2 = true;
            if(version >= 43) Features.GL_VERSION_4_3 = true;
            if(version >= 44) Features.GL_VERSION_4_4 = true;
            if(version >= 45) Features.GL_VERSION_4_5 = true;
            if(version >= 46) Features.GL_VERSION_4_6 = true;
            
